import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './pages/Home';

const routes = [
  {
    path: '/signup',
    exact: true,
    component: "Signup",
  },
  {
    path: '/signin',
    exact: true,
    component: "Signin",
  },
  {
    path: '/',
    component: "Home",
    routes: [
      {
        path: '/products/:id',
        exact: true,
        component: Product,
      },
      {
        path: '/products/:id/edit',
        exact: true,
        component: EditProduct,
      },
    ],
  },
];

function renderRoutes(route) {
  return (
    <Route
      key={route.path}
      path={route.path}
      exact={route.exact}
      render={(props) => (
        <route.component {...props}>
          {route.routes && (
            <Switch>
              {route.routes.map((subRoute) => renderRoutes(subRoute))}
            </Switch>
          )}
        </route.component>
      )}
    />
  );
}

function App() {
  return (
    <BrowserRouter>
      <Switch>{routes.map((route) => renderRoutes(route))}</Switch>
    </BrowserRouter>
  );
}
